import axios from 'axios';

export const getVGCardsAndBoosters = (keywords) => {
    console.log(keywords)
    return axios.get(`https://card-fight-vanguard-api.ue.r.appspot.com/api/v1/card`)
    .then(res=>{
        return res.data
    })
   
}
